import React from 'react';
import HomeLogo from './../images/Home.png';
import './styles/Home.css';

const Home = () => {
    return (
        <React.Fragment>
            <div className=''>
                <img src={HomeLogo} alt='Home logo' className='HomeLogo'/>
                <h2>Stay Curious</h2>
            </div>    


        </React.Fragment>
    )
}

export default Home;
